import React from 'react';
import './styles.css'; 

class App extends React.Component {
  // Add constructor here if you plan to use state

  handleSubmit = (event) => {
    event.preventDefault();
    // Here you'll handle the submission of the form
    // For example, you can log the form data or send it to the server
  };

  render() {
    return (
      <div className="container">
        <h1>Add a New Restaurant</h1>
        <form onSubmit={this.handleSubmit} className="restaurant-form">
          {/* Your form inputs here */}
          <button type="submit" className="add-button">Add New Restaurant</button>
        </form>
      </div>
    );
  }
}

export default App;
